import React, { useState } from 'react';
import { Link, useLocation } from 'react-router-dom';
import Logo from './Logo';
import './Header.css';

const Header = () => {
  const location = useLocation();
  const isHomePage = location.pathname === '/';
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);

  const handleDropdownMouseEnter = () => {
    setIsDropdownOpen(true);
  };

  const handleDropdownMouseLeave = () => {
    setIsDropdownOpen(false);
  };

  const handleDropdownFocus = () => {
    setIsDropdownOpen(true);
  };

  const handleDropdownBlur = (e) => {
    // 检查焦点是否仍在下拉菜单内
    if (!e.currentTarget.contains(e.relatedTarget)) {
      setIsDropdownOpen(false);
    }
  };

  const handleKeyDown = (e) => {
    if (e.key === 'Escape') {
      setIsDropdownOpen(false);
    }
  };

  return (
    <header className="header">
      <div className="container">
        <div className="header-content">
          <Logo />
          <nav className="nav">
            <ul className="nav-list">
              <li><Link to="/about" className={location.pathname === '/about' ? 'active' : ''}>About</Link></li>
              <li 
                className="nav-item dropdown"
                onMouseEnter={handleDropdownMouseEnter}
                onMouseLeave={handleDropdownMouseLeave}
                onFocus={handleDropdownFocus}
                onBlur={handleDropdownBlur}
                onKeyDown={handleKeyDown}
              >
                <button 
                  className={`nav-link dropdown-toggle ${location.pathname === '/solution' || location.pathname === '/hardware' ? 'active' : ''}`}
                  aria-expanded={isDropdownOpen}
                  aria-haspopup="true"
                >
                  Solution
                </button>
                <ul className={`dropdown-menu ${isDropdownOpen ? 'show' : ''}`}>
                  <li>
                    <Link 
                      to="/solution" 
                      className="dropdown-item"
                      onClick={() => setIsDropdownOpen(false)}
                    >
                      IT Service
                    </Link>
                  </li>
                  <li>
                    <Link 
                      to="/hardware" 
                      className="dropdown-item"
                      onClick={() => setIsDropdownOpen(false)}
                    >
                      Hardware
                    </Link>
                  </li>
                </ul>
              </li>
              <li><Link to="/contract-vehicles">Contract vehicles</Link></li>
              <li><a href={isHomePage ? "#employee" : "/#employee"}>Employee portal</a></li>
              <li><Link to="/careers" className={location.pathname === '/careers' ? 'active' : ''}>Careers</Link></li>
              <li><Link to="/news" className={location.pathname === '/news' ? 'active' : ''}>News</Link></li>
            </ul>
          </nav>

          {/* 联系图标 */}
          <div className="contact-icons">
            <Link to="/contact" className="contact-icon-link" title="Send Email">
              <svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                <path d="M20 4H4C2.9 4 2.01 4.9 2.01 6L2 18C2 19.1 2.9 20 4 20H20C21.1 20 22 19.1 22 18V6C22 4.9 21.1 4 20 4ZM20 8L12 13L4 8V6L12 11L20 6V8Z" fill="#000000"/>
              </svg>
            </Link>
            <Link to="/contact" className="contact-icon-link" title="Call Us">
              <svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                <path d="M6.62 10.79C8.06 13.62 10.38 15.94 13.21 17.38L15.41 15.18C15.69 14.9 16.08 14.82 16.43 14.93C17.55 15.3 18.75 15.5 20 15.5C20.55 15.5 21 15.95 21 16.5V20C21 20.55 20.55 21 20 21C10.61 21 3 13.39 3 4C3 3.45 3.45 3 4 3H7.5C8.05 3 8.5 3.45 8.5 4C8.5 5.25 8.7 6.45 9.07 7.57C9.18 7.92 9.1 8.31 8.82 8.59L6.62 10.79Z" fill="#000000"/>
              </svg>
            </Link>
          </div>

          <Link to="/contact" className="btn btn-primary">
            Contract
          </Link>
        </div>
      </div>
    </header>
  );
};

export default Header;
